const ProjectDatabase=JSON.parse(localStorage.getItem("storeProject")),projectEl=document.getElementById("projects");for(let e in ProjectDatabase){const t=ProjectDatabase[e];for(let e=0;e<t.length;e++){let a=t[e];projectEl.innerHTML+=`\n        <article class="project_article">\n            <picture>${a.image}</picture>\n                <h2>${a.title}</h2>\n                <h3>${a.teammates}</h3>\n                <h4><a href="http://${a.website}" target="_blank">${a.website}</a></h4>\n                <h5>${a.techniques}</h5>\n                <h6>${a.published}</h6>\n                <p>${a.body}</p>\n        </article>\n        `}}